import React, { Component } from 'react';
import axios from "axios";


class ContactPhone extends Component {

    constructor(props){
        super(props);
        this.state={linkUserId:'' ,userData:{} }
    }

    static getDerivedStateFromProps(nextProps){
        return {linkUserId: nextProps.match.params.ID}
    }

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/users/'+this.state.linkUserId).
        then(res => this.setState({userData : res.data})
        ).catch(err => console.log(err));
    }

    componentDidUpdate(){return true;}

    back=()=>{
        console.log(this.props.history , 'rout history');
        this.props.history.push('/contact/:ID');
    };

    render() {

        return (
            <div className="">
                Phone:{this.state.userData.phone}<br/>
                <input type='button' value='Back' onClick={this.back}/>
            </div>
        );
    }
}

export default ContactPhone;
